  const [curDate, setCurDate] = useState(new Date());
  console.log(curDate);
  const headerText = `${curDate.getFullYear()}년 ${curDate.getMonth() + 1}월`;

  return (
    <div>
      <MyHeader headerText={headerText} leftChild={<MyButton text={'<'}/>} />
      <h2>Home</h2>
    </div>
  );
};

export default Home;
